    "strDescriptionES":"Petr Čech (AFI: ˈpɛtr̩ ˈtʃɛx) (Pilsen, Checoslovaquia, 20 de mayo de 1982) es un futbolista checo. Se desempeña como guardameta y actualmente milita en el [Arsenal Football Club]] de la Premier League de Inglaterra. También es el guardameta titular de la selección checa. Anteriormente jugó para equipos como el Chmel Blšany, el Sparta Praga y el Stade Rennais. Fue elegido para estar en el equipo del torneo de la Eurocopa 2004, al haber ayudado a su selección a llegar hasta semifinales. Čech también ha sido galardonado con el Premio al Guardameta del Año de la UEFA en las temporadas 2004-05, 2006-07 y 2007-08 de la Liga de Campeones. Es considerado uno de los mejores guardametas de todos los tiempos.2 3\r\n\r\nČech posee varios récords como guardameta, incluyendo el récord en la Premier League por el menor número de apariciones requeridas para poder alcanzar 100 porterías imbatidas, lográndolo hacer en 180 partidos de liga. También posee un récord en la liga de su país, al no encajar goles en 903 minutos jugados. Además, también tiene un récord en su antiguo club Sparta Praga, al haber jugado 928 minutos sin encajar un gol en todas las competiciones durante la temporada 2001-02, cuando su racha de porterías imbatidas en la liga checa se combinaba con su desempeño en la Liga de Campeones. Durante la temporada 2004-05, Čech no permitió un sólo gol en 1025 minutos, lo cual fue un récord en la Premier League, hasta que el 27 de enero de 2009 fue superado por el guardameta del Manchester United, Edwin van der Sar. Čech también ganó dos Guantes de Oro en las temporadas 2004-05 y 2009-10 de la Premier League por haber mantenido más porterías imbatidas. El 11 de enero de 2014, Čech obtuvo el récord de más porterías imbatidas en todas las competiciones con el Chelsea, superando el récord de Peter Bonetti.",
