    "strBirthLocation":"Yerevan, Armenian SSR, Soviet Union",
    "strDescriptionEN":"Henrikh Mkhitaryan  born 21 January 1989) is an Armenian professional footballer who plays as a midfielder for English club Arsenal, as well as captaining the Armenia national team. Mkhitaryan is Armenia's all-time top goalscorer, scoring 19 goals in 59 international matches since his debut in January 2007, including their first hat-trick. His previous clubs include Pyunik, where he came through the youth system, Metalurh Donetsk, Shakhtar Donetsk and Borussia Dortmund.\r\n\r\nMkhitaryan has been chosen Armenian Footballer of the Year five times (every year since 2009, except 2010). In 2012 he was voted as the best Shakhtar player of 2011–12 season by the fans, and Ukraine Premier League MVP. In 2012, Mkhitaryan was named in UEFA's Top 100 players by UEFA European Football Yearbook 2012–13. Mkhitaryan was voted the CIS Footballer of the Year for 2012, making him the first Armenian footballer to be named the best player from post-Soviet countries. He received the award again for 2013. Mkhitaryan received the nickname Heno from his fans in Armenia and has been nicknamed Micki by his Borussia Dortmund fans.\r\n\r\nMkhitaryan was born on 21 January 1989 in the Armenian capital Yerevan to Marina Taschyan and Hamlet Mkhitaryan, a prominent striker of FC Ararat Yerevan during the 1980s, who died of a brain tumor at age 33 when Mkhitaryan was seven years old. His mother is the head of the national teams department in the Armenian Football Federation and his elder sister, Monica, works at UEFA's headquarters.\r\n\r\nAt the beginning of the 1990s, the Mkhitaryan family moved to France, where Hamlet Mkhitaryan played for the now defunct ASOA Valence and helped them to be promoted to the second division Ligue 2. Mkhitaryan spent his early childhood in Valence. He always wanted to become a football player and began to follow in his father's footsteps. As a child, he would watch his father play and always wanted to follow him to training. The Mkhitaryans returned to Yerevan in 1995. In the same year Mkhitaryan joined the youth system of FC Pyunik. He graduated from the Institute of Physical Culture in Armenia. He studied economics at the Yerevan branch of the St. Petersburg Institute. Upon graduation, he plans to study there as a lawyer. In 2003, Mkhitaryan, aged 14 had trials with São Paulo in Brazil where he played alongside the likes of Hernanes and Oscar. He returned back to Pyunik in 2004, then manager Mihai Stoichiță insisted on his return to Armenia. Growing up, Mkhitaryan considered Zinedine Zidane his football idol.\r\n\r\nMkhitaryan is an attacking midfielder capable of playing second striker as well. He thrives playing just behind the strikers, where he always looks to link up with his teammates in and around the box. Tearing apart opposition defences time and time again, he makes space for the striker/wingers to exploit and create goal scoring opportunities. Mkhitaryan has been praised for his technique, movement, accurate passing, dribbling, creativity, ball control and work rate. He is equipped with a dangerous shot, trickery to beat defenders, and a superb vision to go for the pass.\r\n\r\nDuring the 2012–13 season, former Scottish footballer Pat Nevin said of Mkhitaryan, \"Eleven goals in eight league matches already is fantastic, but when you add that he is a midfielder, it is phenomenal. You may not have heard of him yet, even if all the scouts at the top European clubs have, but you soon will. He has pace, skill, a rocket of a shot and the ability to arrive in the box like Frank Lampard. This all singles him out as a player who must be watched or more importantly marked.\"",
