    "strDescriptionEN":"Konstantinos Mavropanos (born 11 December 1997) is a Greek professional footballer who plays as a defender for Arsenal in the Premier League.\r\n\r\nCareer\r\nPAS Giannina\r\nBorn in Athens, Mavropanos began his career with the youth side at Apollon Smyrni where he stayed for eight years. He then joined Superleague Greece side PAS Giannina in January 2016, signing a three-and-a-half year contract. Mavropanos made his competitive debut for PAS Giannina in the Greek Cup on 29 November 2016. He started and played the full match as PAS Giannina won 1–0.\r\n\r\nMavropanos made his league debut for PAS Giannina on 5 April 2017 against Veria. He started and played 57 minutes as PAS Giannina lost 3–0. He scored his first goal for the club on 19 August 2017 during the first league match of the season against Asteras Tripoli. His 19th minute goal would be winner in a 2–1 victory. Mavropanos was then voted man of the match in PAS Giannina's draw against Athens on 27 August.\r\n\r\nArsenal\r\nOn 4 January 2018, it was announced that Mavropanos had signed for Premier League side Arsenal.",
