    "strDescriptionEN":"Stephan Lichtsteiner (born 16 January 1984) is a Swiss professional footballer who plays for English club Arsenal and the Switzerland national team. An attacking right-back or wing-back, he is known for his energetic runs down the right wing, as well as his stamina and athleticism, which earned him the nicknames \"Forrest Gump\" and \"The Swiss Express\".\r\n\r\nHe began his professional career with Grasshopper Zürich, winning a league title in 2002–03, and moved to Lille in 2005, helping the French club to Champions League qualification in his first season with the team. In 2008, he joined Italian club Lazio, and won both the Coppa Italia and Supercoppa Italiana the following year. In 2011, he signed for Juventus for a fee of €10 million. He played 257 total games for them over seven years and won 14 trophies, including Serie A in each of his seasons.\r\n\r\nA full international since 2006, Lichtsteiner has earned over 100 caps for Switzerland, making him their fourth most capped player of all time. He has represented his country at two UEFA European Championships and three FIFA World Cups.",
