    "strDescriptionEN":"Víctor Guillermo Álvarez Delgado (Spanish pronunciation: ; born 14 March 1993) is a Spanish professional footballer who plays for Russian club FC Arsenal Tula. Mainly a left back, he can also play as a left winger.\r\n\r\nClub career\r\nEspanyol\r\nBorn in Barcelona, Catalonia, Álvarez made his senior debuts at only 17, competing with RCD Espanyol's reserves in the fourth division. On 6 March 2011, he made his first-team – and La Liga – debut, replacing fellow youth graduate David García for the last two minutes of a 0–1 away loss against Levante UD.\r\n\r\nOn 25 March 2013, Álvarez signed a new four-year deal with the Pericos, being also definitely promoted to the main squad. However, he underwent surgery in late May due to a cardiovascular disease, only returning to the fields six months later in a 4–1 away routing of Rayo Vallecano.\r\n\r\nÁlvarez scored his first competitive goal for Espanyol on 15 January 2014, helping to a 4–2 home win over AD Alcorcón for the Copa del Rey. His first in the league came on 22 September 2015, the only in a 1–0 success against Valencia CF also at the Estadi Cornellà-El Prat.\r\n\r\nArsenal Tula\r\nOn 20 July 2017, Álvarez joined Russian Premier League club FC Arsenal Tula on a two-year contract.",
