    "strDescriptionEN":"Neymar da Silva Santos Júnior (Portuguese pronunciation: ; born 5 February 1992), commonly known as Neymar or Neymar Jr., is a Brazilian professional footballer who plays as a forward for French club Paris Saint-Germain and the Brazil national team.\r\n\r\nNeymar came into prominence at an early age at Santos, where he made his professional debut aged 17. He helped the club win two successive Campeonato Paulista championships, a Copa do Brasil, and the 2011 Copa Libertadores, Santos' first continental title since 1963. Neymar was twice named the South American Footballer of the Year, in 2011 and 2012, before relocating to Europe to join Barcelona. As part of Barça's attacking trio with Lionel Messi and Luis Suárez, he won the continental treble of La Liga, the Copa del Rey, and the UEFA Champions League in the 2014–15 season, followed the next year by the domestic double. He came third for the FIFA Ballon d'Or in 2015. In August 2017, Neymar moved from Barcelona to Paris Saint-Germain in a transaction worth €222 million, making him the world's most expensive player.\r\n\r\nWith 53 goals in 83 matches for Brazil since debuting at age 18, Neymar is the fourth-highest goalscorer for his national team. He was a key player in Brazil's victories at the 2011 South American Youth Championship, which he finished as the leading goalscorer, and the 2013 FIFA Confederations Cup, where he won the Golden Ball as player of the tournament. His participation in the 2014 FIFA World Cup and 2015 Copa América was cut short by injury and a suspension respectively, but the next year he captained Brazil to their first Olympic gold medal in men's football at the 2016 Summer Olympics.\r\n\r\nKnown for his dribbling, finishing, and ability with both feet, Neymar has earned comparisons to former Brazil and Santos forward Pelé. Off the pitch, he ranks among the world's most prominent sportsmen; SportsPro named him the most marketable athlete in the world in 2012 and 2013, and ESPN cited him as the world's fourth-most famous athlete in 2016.",
    "strDescriptionDE":null,
    "strDescriptionFR":null,
    "strDescriptionCN":null,
    "strDescriptionIT":null,
    "strDescriptionJP":null,
    "strDescriptionRU":null,
    "strDescriptionES":"Neymar da Silva Santos Júnior (Mogi das Cruzes, São Paulo, 5 de febrero de 1992), mejor conocido como Neymar o Neymar Jr., es un futbolista brasileño que juega como delantero en el Fútbol Club Barcelona de la Primera División de España.\r\n\r\nEntre sus distinciones individuales destaca el Premio Puskás en 2011, además de el premio al Mejor Jugador Joven del Campeonato Paulista 2009, el de Mejor Delantero y Mejor Jugador del Campeonato Paulista 2010 y el de máximo goleador de la Copa de Brasil 2010 con once goles antes de ser proclamado como el futbolista del año en Sudamérica en 2011 por sus actuaciones en el Santos Futebol Clube brasileño, donde batió varios récords. Fue vencedor de un título de Liga Brasileña y una Copa Libertadores en la que anotó seis goles en trece partidos, convirtiéndose en el mejor jugador de la competición. También jugó un papel clave en la obtención de una doble continental para su equipo, que no conseguía el Santos desde 1963. Recibió el Balón de Bronce de la Copa Mundial de Clubes 2011, donde el Santos consiguió llegar hasta la final, pero fueron derrotados por el club español F. C. Barcelona por un 4-0.\r\n\r\nInternacional absoluto de la selección brasileña desde que debutase en 2010, entre sus logros destaca el ser el máximo goleador del Campeonato del Sur 2011 con nueve goles, incluyendo dos tantos en la final, en la victoria por 6-0 frente a Uruguay, lo que permitió a Brasil ganar su undécimo título en esta competición. Con la selección sub-23 disputó los Juegos Olímpicos de 2012 donde se proclamó subcampeón y en donde es además su máximo goleador histórico con once goles.\r\n\r\nEn 2012, la revista SportsPro nominó a Neymar como el atleta más comercializable en el mundo.2",
