    "strDescriptionEN":"Thomas Meunier (pronounced: ; born 12 September 1991) is a Belgian footballer who plays as a right back for French Ligue 1 club Paris Saint-Germain and Belgium.\r\n\r\nMeunier was signed by Club Brugge from Belgian Third Division team Virton in January 2011, with the actual transfer to be completed during the 2011 summer transfer period. A few days earlier, Club Brugge had just missed out on the transfers of Dalibor Veselinović and Jelle Van Damme and therefore wanted to make sure Meunier would not become the third near miss. Club Brugge managed to complete the deal before any of the several other interested Belgian clubs (Anderlecht, Standard Liège, Sint-Truiden and Zulte Waregem) could.\r\n\r\nOn 31 July 2011, Club Brugge played its first match of the 2011–12 season against Westerlo in which Meunier was allowed to play the final 20 minutes. Meunier played a decent match, getting on the score sheet in the process. At the time, Meunier was played as a striker or right winger, before he was formed into a right back by his following coaches Juan Carlos Garrido and Georges Leekens due to a lack of players of that position after the injuries of his teammates Tom Høgli and Davy De Fauw.\r\n\r\nMeunier also played every minute of the 2015 Belgian Cup Final against rivals RSC Anderlecht, which ended in a 2-1 win for Club Brugge which enabled it to win its first Belgian Cup since 2007.\r\n\r\nOn 3 July 2016, Paris Saint-Germain announced that Meunier had just joined PSG on a four-year deal that would tie him to the club until 30 June 2020.The transfer fee was reported to be 7 million euros.In the 2016 International Champions Cup friendly match against Real Madrid in Ohio, Thomas Meunier scored twice to help PSG to a 3–1 win. On 6 Aug 2016, Meunier made his first competitive appearance for PSG by coming on as a substitute for David Luiz in the 76th minute of the 2016 Trophée des Champions. On 1 Nov, Meunier assisted Blaise Matuidi's opening goal and scored the winning goal with a stunning 90th-minute side-footed curling volley in PSG's 2-1 away win against Basel in a 2016-17 UEFA Champions League Group A match; it was Meunier's first competitive goal for PSG.",
