    "strDescriptionEN":"Kylian Mbappé Lottin (French pronunciation: ​; born 20 December 1998) is a French professional footballer who plays as a forward for Paris Saint-Germain and the France national team.\r\n\r\nMbappé came into prominence at an early age, starring for the youth academies at AS Bondy, INF Clairefontaine, and AS Monaco, making his debut as a professional for the reserve team of the last. Mbappé soon became a regular starter and goalscorer for the first team in the 2016–17 season, helping the club gain their first Ligue 1 title in seventeen years. The following season he joined Paris Saint-Germain on an initial loan, with a deal in place to join the club permanently at the end of the season for a fee of around €180 million, making him the most expensive teenager, and second most expensive player ever.\r\n\r\nMbappé made his senior international debut for France in March 2017, after previously representing them at under-17 and under-19 levels. By scoring a goal against Peru at the 2018 FIFA World Cup he became the youngest French goalscorer at the World Cup at age 19. With two goals against Argentina in the round of 16 game at the same World Cup he became the second teenager to score twice in a World Cup match after Pelé in 1958. He subsequently joined Pelé again as the second teenager to score a goal in a World Cup Final with a strike against Croatia in a 4–2 win for France. Mbappé also received the FIFA World Cup Best Young Player Award.",
